import React from 'react';
import { Segment } from 'semantic-ui-react';

export default function Footer() {
  return (
    <Segment inverted vertical attached='bottom' style={{ minHeight: "99vh", display: "flex", flexDirection: "column" }}>
      <h1> Footer</h1>
    </Segment>
  );
}
